import React from 'react';
import Landing from './Landing';
// import Portfolio from './Portfolio';
import Contact from './Contact';
import webDevImage from '../assets/gfp-web-dev.jpeg';
import uiDesignImage from '../assets/gfp-ui-design.jpeg';
import systemsImage from '../assets/gfp-systems.jpeg';
import './carousel.css';

const windows = [
   {
      src: webDevImage,
      alt: 'gallery image',
      title: 'Full-Stack Development',
      desc: 'Description of project and technologies used maybe some icons'
   },
   {
      src: uiDesignImage,
      alt: 'gallery image',
      title: 'User Interface Design',
      desc: 'Description of project and technologies used maybe some icons'
   },
   {
      src: systemsImage,
      alt: 'gallery image',
      title: 'Systems Engineering',
      desc: 'Description of project and technologies used maybe some icons'
   }
];

export default function Panel() {
   // const webDevObj = {
   //    src: webDevImage,
   //    alt: 'gallery image',
   //    title: 'Full-Stack Development',
   //    desc: 'Description of project and technologies used maybe some icons'
   // };

   // const uiDesignObj = {
   //    src: uiDesignImage,
   //    alt: 'gallery image',
   //    title: 'User Interface Design',
   //    desc: 'Description of project and technologies used maybe some icons'
   // };

   // const systemsObj = {
   //    src: systemsImage,
   //    alt: 'gallery image',
   //    title: 'Systems Engineering',
   //    desc: 'Description of project and technologies used maybe some icons'
   // };

   const CreateSkillPanel = (img, title, desc, link) => {
      return (
         <div class='card mb-3'>
            <div class='row g-0'>
               <div class='col-md-4'>
                  <img className='card-img' src={img} alt='User Interface Design' />
               </div>
               <div class='col-md-8'>
                  <div class='card-body'>
                     <h5 class='card-title'>{title}</h5>
                     <p class='card-text'>{desc}</p>
                     <p class='card-text'>
                        <small class='text-body-secondary'>See more here {link}</small>
                     </p>
                  </div>
               </div>
            </div>
         </div>
      );
   };
   return (
      <>
         <div id='glassPaneCarousel' className='carousel slide align-middle'>
            <div className='carousel-indicators'>
               <button
                  type='button'
                  data-bs-target='#glassPaneCarousel'
                  data-bs-slide-to='0'
                  className='active'
                  aria-current='true'
                  aria-label='Slide 1'
               ></button>
               <button
                  type='button'
                  data-bs-target='#glassPaneCarousel'
                  data-bs-slide-to='1'
                  aria-label='Slide 2'
               ></button>
               <button
                  type='button'
                  data-bs-target='#glassPaneCarousel'
                  data-bs-slide-to='2'
                  aria-label='Slide 3'
               ></button>
               <button
                  type='button'
                  data-bs-target='#glassPaneCarousel'
                  data-bs-slide-to='3'
                  aria-label='Slide 4'
               ></button>
            </div>
            <div className='carousel-inner'>
               <div className='carousel-item active'>
                  <Landing />
               </div>
               {/* <div className='carousel-item'>
                  <Portfolio />
               </div> */}
               {windows.map((w, i) => (
                  <div key={i} className='carousel-item'>
                     <CreateSkillPanel
                        img={w.img}
                        title={w.title}
                        desc={w.desc}
                        link={w.link}
                     />
                  </div>
               ))}
               <div className='carousel-item'>
                  <Contact />
               </div>
            </div>
            <button
               className='carousel-control-prev'
               type='button'
               data-bs-target='#glassPaneCarousel'
               data-bs-slide='prev'
            >
               <span className='carousel-control-prev-icon' aria-hidden='true'></span>
               <span className='visually-hidden'>Previous</span>
            </button>
            <button
               className='carousel-control-next'
               type='button'
               data-bs-target='#glassPaneCarousel'
               data-bs-slide='next'
            >
               <span className='carousel-control-next-icon' aria-hidden='true'></span>
               <span className='visually-hidden'>Next</span>
            </button>
         </div>
      </>
   );
}
